cy.request({
  method: 'POST',
  url: Cypress.env('github_url') + '/user/repos',
  auth: {
    bearer: Cypress.env('github_bearer_token')
  },
  headers: {
    'Content-type': 'application/json'
  },
  body: {
    "name": new_repo_name,
    "description": "This is your first repository",
    "homepage": "https://github.com",
    "private": false,
    "has_issues": true,
    "has_projects": true,
    "has_wiki": true
  }
}).then(function (response) {
  expect(response.status).equal(201);
});

cy.request({
  method: 'GET',
  url: Cypress.env('github_url') + '/repos/praveenreddynarala/' + new_repo_name,
  auth: {
    bearer: Cypress.env('github_bearer_token')
  },
  headers: {
    'Content-type': 'application/json'
  }
}).then(function (response) {
  if (response.status === 200) {
    cy.wrap(response).its('body').should('include', {
      "name": new_repo_name
    });
  } else {
    cy.log('No repository exists!' + response.status);
  }
});

cy.request({
  method: 'GET',
  url: Cypress.env('github_url') + '/repos/praveenreddynarala/' + new_repo_name + '/contents',
  auth: {
    bearer: Cypress.env('github_bearer_token')
  },
  headers: {
    'Content-type': 'application/json'
  },
  failOnStatusCode: false
}).then(function (response) {
  if (response.status === 404) {
    cy.wrap(response).its('body').should('include', {
      "message": "This repository is empty."
    });
  } else {
    cy.log('Failed to verify api request' + response.status);
  }
});

cy.request({
  method: 'PUT',
  url: Cypress.env('github_url') + '/repos/praveenreddynarala/' + new_repo_name + '/contents/README.md',
  auth: {
    bearer: Cypress.env('github_bearer_token')
  },
  body: {
    "message": "my first commit message",
    "committer": {
      "name": "Praveen Reddy Narala",
      "email": "praveenreddy.narala@gmail.com"
    },
    "content": "SGVsbG8sIFdvcmxk"
  }
}).then(function (response) {
  if (response.status == 201) {
    cy.wrap(response).its('body.content').should('include', {
      "name": "README.md"
    });
    cy.wrap(response).its('body.commit.author').should('include', {
      "name": "Praveen Reddy Narala"
    });
    cy.wrap(response).its('body.commit').should('include', {
      "message": "my first commit message"
    });
    cy.wrap(response).its('body.content.sha').then(function (sha) {
      sha_code = sha;
    });
  }
});

cy.request({
  method: 'PUT',
  url: Cypress.env('github_url') + '/repos/praveenreddynarala/' + new_repo_name + '/contents/README.md',
  auth: {
    bearer: Cypress.env('github_bearer_token')
  },
